import React, { useContext, useState } from 'react';
import { ExpenseContext } from '../context/ExpenseContext';
import './BudgetSettings.css';

const BudgetSettings = () => {
  const { budgets, updateBudget } = useContext(ExpenseContext);
  const [newCategory, setNewCategory] = useState('');
  const [newAmount, setNewAmount] = useState('');
  
  const categories = [
    'Food', 'Housing', 'Transportation', 'Entertainment', 
    'Utilities', 'Healthcare', 'Shopping', 'Personal Care', 'Education', 'Other'
  ];
  
  const handleSubmit = (e) => {
    e.preventDefault();
    
    if (!newCategory || !newAmount) {
      alert('Please select a category and enter an amount');
      return;
    }
    
    updateBudget(newCategory, parseFloat(newAmount));
    setNewCategory('');
    setNewAmount('');
  };
  
  const handleUpdate = (category, amount) => {
    const newAmount = prompt(`Enter new budget for ${category}:`, amount);
    if (newAmount !== null) {
      updateBudget(category, parseFloat(newAmount));
    }
  };
  
  return (
    <div className="budget-settings">
      <h1>Budget Settings</h1>
      
      <div className="current-budgets">
        <h2>Current Budgets</h2>
        {Object.keys(budgets).length > 0 ? (
          <table className="budgets-table">
            <thead>
              <tr>
                <th>Category</th>
                <th>Monthly Budget</th>
                <th>Actions</th>
              </tr>
            </thead>
            <tbody>
              {Object.entries(budgets).map(([category, amount]) => (
                <tr key={category}>
                  <td>{category}</td>
                  <td>${parseFloat(amount).toFixed(2)}</td>
                  <td>
                    <button 
                      className="edit-btn"
                      onClick={() => handleUpdate(category, amount)}
                    >
                      Edit
                    </button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        ) : (
          <p>No budgets set yet. Add your first budget below.</p>
        )}
      </div>
      
      <div className="add-budget">
        <h2>Add New Budget</h2>
        <form onSubmit={handleSubmit}>
          <div className="form-row">
            <div className="form-group">
              <label htmlFor="category">Category</label>
              <select
                id="category"
                value={newCategory}
                onChange={(e) => setNewCategory(e.target.value)}
                required
              >
                <option value="">Select a category</option>
                {categories
                  .filter(category => !budgets[category])
                  .map((category) => (
                    <option key={category} value={category}>{category}</option>
                  ))}
              </select>
            </div>
            
            <div className="form-group">
              <label htmlFor="amount">Monthly Budget</label>
              <input
                type="number"
                id="amount"
                value={newAmount}
                onChange={(e) => setNewAmount(e.target.value)}
                min="1"
                step="0.01"
                placeholder="0.00"
                required
              />
            </div>
            
            <button type="submit" className="add-btn">Add Budget</button>
          </div>
        </form>
      </div>
    </div>
  );
};

export default BudgetSettings;
